import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "./App.css";
import Navbar from "./component/navbar";
import Home from "./component/home";
import Authentication from "./component/log_reg_feed";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Router>
          <div className="App">
            <Navbar />
            <Switch>
              <Route exact path="/">
                <Home />
              </Route>
              <Route path="/register">
                <Authentication HrefLocation={"/registerrr"} />
              </Route>
              <Route path="/login">
                <Authentication HrefLocation={"/login"} />
              </Route>
              <Route path="/feedback">
                <Authentication HrefLocation={"/feedback"} />
              </Route>
            </Switch>
          </div>
        </Router>
      </header>
    </div>
  );
}

export default App;
